import React from 'react'
import login from "../assets/login.png";

class Header extends React.Component {
    render() {
        return (
                <header>
                    <img src={login} alt="" className="logo"/>
                    <div className="right">右侧</div>
                </header>
        )
    }
}
export default Header;
